  selector: 'app-successful-pay',
  templateUrl: './successfulPay.component.html',
  styleUrls: ['./successfulPay.component.css']
})
export class SuccessfulPayComponent {

}
<div class="mainBox"><!-- D  -->
    <div class="logo"></div>
    <div class="titlePay"><!--Div que contiene el numero de error -->
        <p>Successful Pay</p><!--Numero de error-->
    </div>
    <div class="textPay"><!--Div que contiene el logo de la empresa-->
